import ExpenseItem from './ExpenseItem';
import './Expenses.css';


function Expenses(props) {
   
    return (
        <div>
            <ExpenseItem title={props.items[0].title} ammount={props.items[0].amount} date={props.items[0].date} />
            <ExpenseItem title={props.items[1].title} ammount={props.items[1].amount} date={props.items[1].date} />
            <ExpenseItem title={props.items[0].title} ammount={props.items[2].amount} date={props.items[2].date} />
            <ExpenseItem title={props.items[0].title} ammount={props.items[3].amount} date={props.items[3].date} />
        </div>
    )
}

export default Expenses
